import React from 'react';
import PieChart from 'react-minimal-pie-chart';
import './CycleGraph.css';


class CycleGraph extends React.Component {
    render() {
        return (
            <div className="ui container">
                <PieChart data={[
                    {
                        title: 'One',
                        value: 10,
                        color: '#E38627'
                    },
                    {
                        title: 'Two',
                        value: 15,
                        color: '#C13C37'
                    },
                    {
                        title: 'Three',
                        value: 20,
                        color: '#6A2135',

                    },
                    {
                        title: 'Four',
                        value: 20,
                        color: '#173f6a',
                    }
                ]}

                          lineWidth={30}
                          paddingAngle={5}
                          lengthAngle={-360}
                          style={{height: '200px'}}

                          label={({ data, dataIndex }) =>
                              Math.round(data[dataIndex].percentage) + '%'
                          }
                          labelStyle={{
                              fontSize: '5px',
                              fontFamily: 'sans-serif'}}
                          labelPosition={60}
                          animate

                />
                <div>
                    
                </div>
            </div>
        );
    }
}

export default CycleGraph;
